#include <stdio.h>
#include <stdlib.h>


// Estrutura auxiliar de fila para BFS
typedef struct QueueNode {
    struct TreeNode* node;
    int level;
} QueueNode;

int** levelOrder(struct TreeNode* root, int* returnSize, int** returnColumnSizes) {
    if (!root) {
        *returnSize = 0;
        *returnColumnSizes = NULL;
        return NULL;
    }

    int maxNodes = 2000;
    QueueNode queue[maxNodes];
    int front = 0, rear = 0;

    // Alocação inicial para resultados
    int** result = (int**)malloc(sizeof(int*) * maxNodes);
    int* columnSizes = (int*)malloc(sizeof(int) * maxNodes);
    int resultSize = 0;

    // Para armazenar temporariamente os valores de cada nível
    int* levelData[maxNodes];
    int levelCounts[maxNodes];
    for (int i = 0; i < maxNodes; ++i) {
        levelData[i] = (int*)malloc(sizeof(int) * maxNodes);
        levelCounts[i] = 0;
    }

    // Inicializa a fila com a raiz
    queue[rear++] = (QueueNode){root, 0};

    while (front < rear) {
        QueueNode current = queue[front++];
        struct TreeNode* node = current.node;
        int level = current.level;

        levelData[level][levelCounts[level]++] = node->val;

        if (node->left) {
            queue[rear++] = (QueueNode){node->left, level + 1};
        }
        if (node->right) {
            queue[rear++] = (QueueNode){node->right, level + 1};
        }
    }

    // Copia os dados para a estrutura final
    for (int i = 0; i < maxNodes && levelCounts[i] > 0; i++) {
        result[i] = (int*)malloc(sizeof(int) * levelCounts[i]);
        for (int j = 0; j < levelCounts[i]; j++) {
            result[i][j] = levelData[i][j];
        }
        columnSizes[i] = levelCounts[i];
        resultSize++;
    }

    *returnSize = resultSize;
    *returnColumnSizes = columnSizes;
    return result;
}
